import React, { useState, useEffect } from "react";
import Dropdown from 'react-bootstrap/Dropdown';
import YearLineChart from "./YearLineChart";
import FilterByMonthApi from "../../controllers/FilterByMonthApi";
import FilterByDayApi from "../../controllers/FilterByDayApi";
import FilterAcrossYearsApi from "../../controllers/FilterAcrossYearsApi";

function TimeSelect(props) {

    let years = []
    const [Year, changeYear] = useState('Year')
    const [Month, changeMonth] = useState('Month')

    const [load, setLoad] = useState(0);

    for(let year=1996; year<=2022; year++) {
        years.push(
            <button onClick={(e) => { props.setStatus1(1); props.setStatus2(year); changeYear(e.target.value); callYear(year); }}
            class="dropdown-item" type="button" value={year}>{year}</button>
        )
    }

    const [monthsInfo, setMonthsInfo] = useState([]);
    const [daysInfo, setDaysInfo] = useState([]);


    async function callYear(year) {
        let temp = await FilterByMonthApi(year);
        console.log("temp is:", temp);
        setMonthsInfo(temp);
        props.setYearData(temp);
        setLoad(1);
      }

    async function callMonth(month, year) {
        if(!year){
          year = 1999
        }
        console.log("year:", year, "month", month);
        let temp = await FilterByDayApi(month, year);
        console.log("temp is:", temp);
        setDaysInfo(temp);
        setLoad(1);
    }



    return (
        <div>

        <div className="row gx-0">
            <div className="col yearcol">
                <div class="dropdown">
                    <button className="btn generalbtn btn-secondary dropdown-toggle" type="button" id="dropdownMenu1" data-toggle="dropdown"
                    aria-haspopup="true" aria-expanded="false" >{Year}</button>
                    <div class="dropdown-menu dropdown-menu-end">
                        {years}
                    </div>
                </div>
            </div>


            <div className="col monthcol">
                <div class="dropdown">
                    <button className="btn generalbtn btn-secondary dropdown-toggle" type="button" id="dropdownMenu2" data-toggle="dropdown"
                    aria-haspopup="true" aria-expanded="false">{Month}</button>
                    <div class="dropdown-menu dropdown-menu-end">
                        <button  onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(1);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);

                        }}
                            class="dropdown-item" value="1" type="button" id = "jan">Jan</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(2);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "2" type="button" id = "feb">Feb</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(3);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value="3" type="button" id = "mar">Mar</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(4);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "4" type="button" id = "apr">Apr</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(5);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "5" type="button" id = "may">May</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(6);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "6" type="button" id = "jun">Jun</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(7);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "7" type="button" id = "jul">Jul</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(8);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "8" type="button" id = "aug">Aug</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(9);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "9" type="button" id = "sep">Sep</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(10);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "10" type="button" id = "oct">Oct</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(11);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "11" type="button" id = "nov">Nov</button>
                        <button onClick={(e) => {
                            props.setStatus1(2);
                            props.setStatus2(12);
                            changeMonth(e.target.value);
                            callMonth(e.target.value, Year);
                        }}
                            class="dropdown-item" value = "12" type="button" id = "dec">Dec</button>

                    </div>
                </div>
            </div>

            <div className="col datecol">
                <div class="dropdown">
                    <button className="btn generalbtn btn-secondary dropdown-toggle" type="button" id="dropdownMenu3" data-toggle="dropdown"
                    aria-haspopup="true" aria-expanded="false">Date</button>
                    <div class="dropdown-menu dropdown-menu-end">
                        {/* <button class="dropdown-item" type="button">Action</button>
                        <button class="dropdown-item" type="button">Another action</button>
                        <button class="dropdown-item" type="button">Something else here</button> */}
                    </div>
                </div>
            </div>

        </div>

        </div>
      );
}

export default TimeSelect;
